import s from './Nav.module.css';

const Nav = () => {
    return <nav className={s.nav}>
        <div className={s.item}><a href='/profile'>Profile</a></div>
        <div><a href='messages'>Message</a></div>
        <div><a>News</a></div>
        <div className={`${s.item} ${s.active}`}><a>Musik</a></div>
        <div><a>Settings</a></div>
        <div><a>Helps</a></div>
        <div><a>Settings33</a></div>
    </nav>
}

export default Nav;
